  false,\n\t\"url\": null,\n\t\"notes\": \"nThis data set consists of glacier outline,
  laser altimetry profile, and surface elevation change data for 46 glaciers in Alaska
  and British Columbia, Canada, measured with an airborne laser altimetry system.
  Six glaciers in the Alaska Range of central Alaska, two glaciers in the Wrangell
  Mountains of southcentral Alaska, 11 glaciers in the Chugach Mountains of southcentral
  Alaska, five glaciers in the Chigmit Mountains of southcentral Alaska, 13 glaciers
  in the Kenai Mountains of southcentral Alaska (comprising the Harding Icefield),
  one glacier in the St. Elias Mountains of southeast Alaska, one glacier in the Takhinsha
  Mountains of southeast Alaska, and seven glaciers in the Coast Mountains of southeast
  Alaska and British Columbia were profiled between 1994 and 2001. Surface elevation
  profiles are accurate to about 0.3 m. Long-term elevation changes can be estimated
  by comparison of these profiles with existing maps.n\",\n\t\"license_title\": null,\n\t\"extras\":
